    false,nt"url": null,nt"notes": "This report contains locations and water
    use at Lake Andes NWR for 1958. The report highlights the weather, water, habitat,
    and wildlife conditions for the year of the report. It then recommends for water
    levels and water supply for the following year. Historical information is then supplied
    which is followed by water rights information, more water supply information, other
    management considerations, and expanded recommendations. Bench marks and spillway
    elevations for Lake Andes are provided along with a graph of the natural fluxtuations
    of water level from 1878 to present (1958). Lastly a copy of a SCS Reconnaissance
    report for the Lake Andes Watershed is attached.",nt"license_title": "License
